An algorithm with O(n) complexity runs in linear time, meaning the runtime grows linearly with the input size. Linear Time means the runtime increases proportionally with the input size. If the input size doubles, the time taken roughly doubles. Imagine searching for a book in a single line of books—you have to check each one. The time to find your book increases directly with the number of books. fn main() { let numbers = vec![10, 20, 30, 40, 50]; let target = 30; let found = find_element(&numbers, target); println!("Element found: {}", found);
