An algorithm with O(n^2) complexity runs in quadratic time, meaning the runtime grows quadratically with the input size. Quadratic Time means that if the input size doubles, the runtime will roughly quadruple. This occurs because the algorithm involves nested loops, each iterating over the input size. Imagine comparing each pair of students in a class to find those with the same birthday. If there are n students, you would need to perform n * (n - 1) / 2 comparisons (approximately n^2 comparisons) to check every pair. As the number of students increases, the number of comparisons grows significantly. fn main() { let mut numbers = vec![64, 25, 12, 22, 11]; bubble_sort(&mut numbers); println!("Sorted array: {:?}", numbers);
} fn bubble_sort(arr: &mut Vec<i32>) { let n = arr.len(); for i in 0..n { for j in 0..n - 1 - i { if arr[j] > arr[j + 1] { arr.swap(j, j + 1); } } }
} The main function creates a vector numbers and sorts it using the bubble_sort function. The sorting operation has a time complexity of O(n^2). The bubble_sort function takes a mutable reference to a vector arr and sorts it using the bubble sort algorithm. The time complexity is quadratic because the outer loop iterates over each element, while the inner loop compares and swaps adjacent elements, resulting in roughly n * (n - 1) / 2 comparisons and swaps.

