An algorithm with O(log n) complexity runs in logarithmic time, meaning the runtime grows logarithmically with the input size. This is common in algorithms that divide the problem in half with each step, such as binary search. Logarithmic Time means that as the input size doubles, the runtime increases by a constant amount rather than doubling. This is because the algorithm significantly reduces the problem size with each step. Imagine you're searching for a name in a phone book organized alphabetically. If you start in the middle and determine whether the name you're looking for is before or after that point, you effectively cut the search space in half with each step, making the search much faster than checking each name one by one. fn main() { let numbers = vec![10, 20, 30, 40, 50]; let target = 30; match binary_search(&numbers, target) { Some(index) => println!("Element found at index: {}", index), None => println!("Element not found"), }
} fn binary_search(arr: &Vec<i32>, target: i32) -> Option<usize> { let mut left = 0; let mut right = arr.len() as isize - 1; while left <= right { let mid = (left + right) / 2; let mid_value = arr[mid as usize]; if mid_value == target { return Some(mid as usize); } else if mid_value < target { left = mid + 1; } else { right = mid - 1; } } None // Target not found
} The main function creates a sorted vector numbers and uses binary_search to find the target. The search operation has a time complexity of O(log n). The binary_search function performs a binary search on a sorted vector arr to find the target value. The time complexity is logarithmic because the search space is halved with each step. It starts with the entire array (from left to right). In each iteration, it calculates the midpoint and compares the target with the midpoint value. If the target is less than the midpoint, the search continues in the left half; if it's greater, the search continues in the right half.

