An algorithm with O(n log n) complexity runs in linearithmic time, which is typical of efficient sorting algorithms like Merge Sort and Quick Sort. Linearithmic Time means that the algorithm's runtime increases faster than Linear Time but slower than Quadratic Time. It grows proportionally to the size of the input multiplied by the logarithm of the size of the input. Imagine you have a large stack of unsorted papers that you want to sort. You divide the stack into smaller stacks, sort each smaller stack individually, and then combine them back together in order. The process of dividing, sorting, and merging each stack grows in a way that reflects Linearithmic Time complexity. fn main() { let mut numbers = vec![38, 27, 43, 3, 9, 82, 10]; merge_sort(&mut numbers); println!("Sorted array: {:?}", numbers);
} fn merge_sort(arr: &mut Vec<i32>) { let len = arr.len(); if len <= 1 { return; } let mid = len / 2; let mut left = arr[..mid].to_vec(); let mut right = arr[mid..].to_vec(); merge_sort(&mut left); merge_sort(&mut right); merge(arr, &left, &right);
} fn merge(arr: &mut Vec<i32>, left: &Vec<i32>, right: &Vec<i32>) { let mut left_idx = 0; let mut right_idx = 0; let mut arr_idx = 0; while left_idx < left.len() && right_idx < right.len() { if left[left_idx] <= right[right_idx] { arr[arr_idx] = left[left_idx]; left_idx += 1; } else { arr[arr_idx] = right[right_idx]; right_idx += 1; } arr_idx += 1; } while left_idx < left.len() { arr[arr_idx] = left[left_idx]; left_idx += 1; arr_idx += 1; } while right_idx < right.len() { arr[arr_idx] = right[right_idx]; right_idx += 1; arr_idx += 1; }
} In the main function: We create a vector numbers and sort it using merge_sort. The sorting operation's time complexity is O(n log n). Function merge_sort: This function performs the Merge Sort algorithm. It recursively divides the vector into two halves until each half is trivially sorted (i.e., has one or zero elements). It then merges the sorted halves using the merge function. The time complexity of the merge_sort function is O(n log n). Function merge: This function merges two sorted arrays left and right into a single sorted array arr. The time complexity of the merge function is O(n).

